const InitiaVESample = ""

const DydxVESample = ""

const NeutronVESample = ""

func VEDecodingTest(testVE string) error {
	veBytes, err := base64.StdEncoding.DecodeString(testVE)
	if err != nil {
		return err
	}
	bz, err := MustDecompress(veBytes)
	if err != nil {
		return err
	}
	commitBz, err := DecodeExtendCommitInfo(bz)
	if err != nil {
		return err
	}
	for _, vote := range commitBz.GetVotes() {
		validator := vote.GetValidator()
		fmt.Printf("validator address: %X\t", validator.GetAddress())
		fmt.Printf("validator address: %s\t", hex.EncodeToString(validator.GetAddress())) // Lowercase hex string
		fmt.Printf("commit flags: %s\t", vote.GetBlockIdFlag().String())
		fmt.Printf("ve length: %d\t", len(vote.GetVoteExtension()))
		fmt.Printf("signature: %s\n", base64.StdEncoding.EncodeToString(vote.GetExtensionSignature()))
	}
	return nil
}

func TestVEDecodingByRPC(t *testing.T) {
	url := "rpc-endpoint/block?height=798917"

	// Make a request to the test server
	resp, err := http.Get(url)
	if err != nil {
		t.Fatalf("Failed to make GET request: %v", err)
	}
	defer resp.Body.Close()

	// Check the HTTP response status code
	if resp.StatusCode != http.StatusOK {
		t.Fatalf("Expected status code 200, got %d", resp.StatusCode)
	}

	// Check the response body for the expected metric
	body, err := io.ReadAll(resp.Body)
	if err != nil {
		t.Fatalf("Failed to read response body: %v", err)
	}

	var resultV34 types.CosmosV34BlockResponse
	if err := json.Unmarshal(body, &resultV34); err != nil {
		return
	}

	for _, tx := range resultV34.Result.Block.Data.Txs {
		// t.Logf("tx: %s", tx)
		err := VEDecodingTest(string(tx))
		if err != nil {
			t.Logf("err: %s", err)
		}
	}
	// t.Log(tc.chainName)

}
